import React from 'react'
class Dashboardheading extends React.Component{
    constructor(props){
        super()

    }
render(){
    return(
        <div className="main">
            <div className="heading">
                <div className="headingin">
                    <div className="in1">
                         <h1>DashBoard</h1>
                    
                        
                    </div>
                    <div className="in2">
                        <div>
                        <p> <b><small>Download as PDF</small></b></p>
                        </div>
                    </div>
                </div>
            </div>
        
        <style jsx>{`
        .main{
            width:100%;
        }
        .heading{
            display:flex;
            background:black;
            align-items:center;
            justify-content:center;
            margin-top:200px;
            width:100%;
        }
        .headingin{
            display:flex;
            width:70%;
            background:blue;
            height:170px;
        }
        .in1{
            display:flex;
            align-items: center;
            width:50%;
        }
        .in2{
            display:flex;
            width:50%;
            align-items:flex-center;
            justify-content:flex-end;

        }
        
        
        
        `}

        </style>
        
        
        
        
        </div>
    )


    }



}
export default Dashboardheading;
